	jQuery.ajax(
		{
  		method: "GET",
		  url: 'https://api.ie.com.br/prospect/agencies'
		}).done(function (data) {
			data = data.sort(function (a, b) {
  			if (a.name > b.name) {
    			return 1;
  			}
  			if (a.name < b.name) {
    			return -1;
  			}
  			// a must be equal to b
  			return 0;
			});
			var slc = jQuery('select[name="cf-agency"]');
			data.forEach(dt => {
				var aux = document.createElement('option')
				aux.value = dt.id
				aux.textContent = dt.name
				slc.append(aux)
			});
	});
});





