jQuery(function(){
	
				let nome = document.getElementById('nome')
				let email = document.getElementById('email')
				let phoneagencia = document.getElementById('phoneagencia')
				let datanasc = document.getElementById('datanasc')
				let telcelular = document.getElementById('telcelular')
				let sexo_form_wts = document.getElementById('sexo_form_wts')
				let mensagem = document.getElementById('mensagem')
				
				
				jQuery(nome).blur(function(){
				 	if(jQuery(this).val() == ""){
				 		jQuery(this).css("border", "1px solid #F00");
					} else {
						jQuery(this).css("border", "1px solid #e3e3e3");
					}
				});
	
				jQuery(email).blur(function(){
				 	if(jQuery(this).val() == ""){
				 		jQuery(this).css("border", "1px solid #F00");
					} else {
						jQuery(this).css("border", "1px solid #e3e3e3");
					}
				});
	
				jQuery(datanasc).blur(function(){
				 	if(jQuery(this).val() == ""){
				 		jQuery(this).css("border", "1px solid #F00");
					} else {
						jQuery(this).css("border", "1px solid #e3e3e3");
					}
				});
	
				jQuery(telcelular).blur(function(){
				 	if(jQuery(this).val() == ""){
				 		jQuery(this).css("border", "1px solid #F00");
					} else {
						jQuery(this).css("border", "1px solid #e3e3e3");
					}
				});
      

        // buttons
        let linkHandler = document.getElementById('by-link')
        let popUpHandler = document.getElementById('by-popup')        


        const makeLink = function(mode) {        

            let mount = function() {
								let target = `https://api.whatsapp.com/send?`
								if ( !!phoneagencia && phoneagencia.value !== '' ) {
									target += `phone=${encodeURIComponent(phoneagencia.value)}&`
								}
								if ( !!nome && nome.value !== '' ) {
									target += `text=Ol√°, me chamo ${encodeURIComponent(nome.value)} e gostaria de ser atendido via WhatsApp, `
								}
								if ( !!telcelular && telcelular.value !== '' ) {
									target += ` Telefone: ${encodeURIComponent(telcelular.value)}`
								}
								if ( !!mensagem && mensagem.value !== '' ) {
									target += ` Mensagem: ${encodeURIComponent(mensagem.value)}`
								}
							  if ( !!email && email.value !== '' ) {
									target += ` E-mail: ${encodeURIComponent(email.value)}`
								}
							  if ( !!datanasc && datanasc.value !== '' ) {
									target += ` Data de nascimento: ${encodeURIComponent(datanasc.value)}`
								}
							  if ( !!sexo_form_wts && sexo_form_wts.value !== '' ) {
									target += ` Sexo: ${encodeURIComponent(sexo_form_wts.value)}`
								}
							
								return target
            }        

            let openLink = function() {
                let a = document.createElement('a')
                a.target = '_blank'
                a.href = mount()
                a.click()
            }        

            let openPopUp = function() {
                let h = 650,
                    w = 550,
                    l = Math.floor(((screen.availWidth || 1024) - w) / 2),
                    t = Math.floor(((screen.availHeight || 700) - h) / 2)
                // open popup
                let options = `height=600,width=550,top=${t},left=${l},location=0,menubar=0,toolbar=0,status=0,scrollbars=1,resizable=0`
                let popup = window.open(mount(), 'self', options)
                if ( popup ) {
                    popup.focus()
                }
            }
            
            switch (mode) {
                case 'link':
                    openLink()
                break
                case 'popup':
                    openPopUp()
                break
            }
        } 

        // events handler(s)
        linkHandler.addEventListener('click', function(e) {
					if ( nome.value === '' ) {
						jQuery(nome).css("border", "1px solid #F00");
					} else if ( email.value === '' ) {
						jQuery(email).css("border", "1px solid #F00");
					} else if ( datanasc.value === '' ) {
						jQuery(datanasc).css("border", "1px solid #F00");
					} else if ( telcelular.value === '' ) {
						jQuery(telcelular).css("border", "1px solid #F00");
					} else {
						makeLink('link')
					}
        }, false)
	
        popUpHandler.addEventListener('click', function(e) {
            makeLink('popup')
        }, false)
	
});

